import { Text, View, TextInput, TouchableHighlight, StyleSheet } from "react-native";
import { useState } from "react";
export default function AddNewCourse() {
    const [course, setCourse] = useState({ faculty: "", code: "", title: "" });

    return (
        <View style={styles.container}>
            <Text style={styles.text}>Add New Course</Text>
            <TextInput onChangeText={(text)=>{}}style={styles.input} />
            <TextInput style={styles.input} />
            <TextInput style={styles.input} />
            <TouchableHighlight style={styles.button}>
                <Text style={styles.text}>Submit</Text>
            </TouchableHighlight>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
    },
    input: {
        width: "80",
        borderWidth: 1,
        margin: 10
    },
    button: {
        borderWidth: 1,
        borderColor: '#0066cc',
        borderRadius: 14,
        paddingHorizontal: 10,
        paddingVertical: 3,
        backgroundColor: '#fff',
        marginTop: 10,
    },
    text: {
        color: '#0066CC',
        fontSize: 12,
        textAlign: 'center',
    },
});
